import React from 'react';
import { BrowserRouter, Route } from 'react-router-dom'
import Home from './home/components/Home';
import Navbar from './shared/components/Navbar'


function App() {
  return (
    <BrowserRouter>
      <Navbar />
      <Route path='/' component={Home} />
    </BrowserRouter>
  );
}

export default App;
